import { initializeApp } from "firebase/app";
import { getFirestore } from "firebase/firestore";
import { getStorage } from "firebase/storage";
import { getAuth, signInWithEmailAndPassword } from "firebase/auth";

const firebaseConfig = {
  apiKey: "YOUR_API_KEY",
  authDomain: "finu-d1583.firebaseapp.com",
  projectId: "finu-d1583",
  storageBucket: "finu-d1583.appspot.com",
  messagingSenderId: "1015791608855",
  appId: "1:1015791608855:web:e31b6fc3ced6e98f716852",
  measurementId: "G-YF3VB69M67"
};

const app = initializeApp(firebaseConfig);
const firestore = getFirestore(app);
const storage = getStorage(app);
const auth = getAuth(app);

export { firestore, storage, auth, signInWithEmailAndPassword };
